query:
/*+ NoMergeJoin(ci t) NoHashJoin(ci t mc) */ select count(*)
from cast_info AS ci
inner join title AS t
on t.id = ci.movie_id AND ci.person_id = 1561076 AND t.kind_id > 2 AND t.production_year < 2007
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id < 11203 AND mc.company_type_id < 2;
